import React, { Component } from "react";
import { Error } from "./Error";
import { postRegister } from "../../services/ApiDatings";
import loginImg from '../../login.svg'
import './Register.scss'

export class Register extends React.Component {
  constructor(dni, name, lastName, phone, history) {
    super(dni, name, lastName, phone, history);
    this.state = {};
    this.dni = "";
    this.name = "";
    this.lastName = "";
    this.phone = "";
    this.history = "";
  }

  submitRegister = async e => {
    await postRegister(this.dni, this.name, this.lastName, this.phone, this.history);
    console.log(this.dni);
  };

  handlerDni(e) {
    this.dni = e.target.value;
  }

  handlerName(e) {
    this.name = e.target.value;
  }

  handlerLastName(e) {
    this.lastName = e.target.value;
  }

  handlerPhone(e) {
    this.dni = e.target.value;
  }

  handlerHistory(e) {
    this.history = e.target.value;
  }


  render() {
    return (
      <div className="base-container" ref={this.props.containerRef}>
        <div className="header">Register</div>
        <div className="content">
          <div className="image">
            <img src={loginImg} />
          </div>
          <div className="form">
            <div className="form-group">
              <label htmlFor="username">Dni</label>
              <input type="text" name="username" placeholder="dni" />
            </div>
            <div className="form-group">
              <label htmlFor="email">Name</label>
              <input type="text" name="email" placeholder="name" />
            </div>
            <div className="form-group">
              <label htmlFor="password">Last Name</label>
              <input type="text" name="password" placeholder="last name" />
            </div>
            <div className="form-group">
              <label htmlFor="password">Phone</label>
              <input type="text" name="password" placeholder="phone" />
            </div>
          </div>
        </div>
        <div className="footer">
          <button type="button" className="btn">
            Register
          </button>
        </div>
      </div>
    );
  }
}
